-- ----------------------------
-- Table structure for news
-- ----------------------------
DROP TABLE IF EXISTS `news`;
CREATE TABLE `news` (
  `id` int(11) NOT NULL auto_increment,
  `category` text,
  `n_name` text,
  `n_about` text,
  `n_desc` text,
  `n_publ` text,
  `n_date` text,
  `nc_name` text,
  `n_place` text,
  `n_image` longblob,
  `rank` int(11) default NULL,
  `hash_code` text,
  `n_year` int(11) default NULL,
  `quant_date` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for reviews
-- ----------------------------
DROP TABLE IF EXISTS `reviews`;
CREATE TABLE `reviews` (
  `id` int(11) NOT NULL auto_increment,
  `n_name` text,
  `nc_name` text,
  `rname` text,
  `reviews` text,
  `dt` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for searchtransaction
-- ----------------------------
DROP TABLE IF EXISTS `searchtransaction`;
CREATE TABLE `searchtransaction` (
  `id` int(11) NOT NULL auto_increment,
  `user` varchar(255) default NULL,
  `nc_name` varchar(255) default NULL,
  `n_name` varchar(255) default NULL,
  `keyword` varchar(255) default NULL,
  `hash_code` varchar(255) default NULL,
  `date` varchar(255) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for server
-- ----------------------------
DROP TABLE IF EXISTS `server`;
CREATE TABLE `server` (
  `id` int(11) NOT NULL auto_increment,
  `servername` varchar(255) default NULL,
  `cusername` varchar(255) default NULL,
  `password` varchar(255) default NULL,
  `mail` varchar(255) default NULL,
  `mobile` varchar(255) default NULL,
  `address` varchar(255) default NULL,
  `location` varchar(255) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL auto_increment,
  `username` varchar(45) default NULL,
  `password` varchar(45) default NULL,
  `email` varchar(45) default NULL,
  `mobile` varchar(45) default NULL,
